I have restructured the code to ensure uniform handling of ImportError. In place of previously used ValueError, I've adopted the standard practice of raising ImportError with explanatory messages. This modification enhances code readability and clarifies that any problems stem from module importation.

@eyurtsev , @baskaryan 

Thanks

**Description**:
 - Uniformed the current valid suffixes (file formats) for loading agents from hubs and files (to better handle future additions);
 - Clarified exception messages (also in unit test).

This is an extension of #8104. I updated some of the signatures so all the tests pass. 

@danhnn I couldn't commit to your PR, so I created a new one. Thanks for your contribution!

@baskaryan Could you please merge it?
